	body {

	.wrapper1 {

		width: 150px;
	}

	}

		color: #e6540f;
	}

		font-size: 16px;

		color: #ddf;

		display: none;

		height: 16px;
		line-height: 16px;

	.wrapper2 .wrong::before {
		content: '×';
		color: red;

		width: 50%;

		color: #e69a0f;
	}

		list-style: none;
	}
	.wrapper3 li,
	.wrapper3 .story-end {
